import React from 'react';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import moment from 'moment';
import 'react-big-calendar/lib/css/react-big-calendar.css';
// import { calendrier } from './calendrier';

const localizer = momentLocalizer(moment)

const events = [
    {
      title: 'Meeting',
      start: new Date(2023, 5, 20, 10, 0), // Année, Mois (0-indexed), Jour, Heure, Minute
      end: new Date(2023, 5, 20, 12, 0),   // Année, Mois (0-indexed), Jour, Heure, Minute
    },
    {
      title: 'Lunch Break',
      start: new Date(2023, 5, 21, 12, 0),
      end: new Date(2023, 5, 21, 13, 0),
    },
    // Ajoutez plus d'événements ici
];

export const MyCalendar = () => (
  <div>
    <Calendar
      localizer={localizer}
      events={events}
      startAccessor="debut"
      endAccessor="fin"
      style={{ height: 500 }}
    />
  </div>
)
